type IconType = "hamburger" |  "hamburgerMobile" | "close" |  "closeMobile" | "close" | "logo" | "logoMobile" | "heroLogo" | "arrowUp"

type IconProps = {
  stroke?: boolean
  color?: string | number | any
  width: number
  icon: IconType
  hiddenMobile?: boolean
  hiddenDesktop?: boolean
  neon?: boolean
}

const Icons = ({ stroke = false, color = ``, width, icon, hiddenMobile = false, hiddenDesktop = false , neon = false }: IconProps) => {
  if(neon) {
    color = "#00ffe5"
  } else {
    color = "white"
  }
    
  return(
  <svg
    sx={{
      position: `absolute`,
      stroke: stroke ? `currentColor` : `none`,
      fill: stroke ? `none` : `currentColor`,
      display: hiddenMobile ? hideMobile : (hiddenDesktop ? hideDesktop : `block`),
      overflow: `hidden`,
      color,
      width,
    }}
    viewBox={icons[icon].viewBox}
  >
    {icons[icon].shape}
  </svg>
)}

export default Icons
